column1003:
На проверку предоставлена итоговая таблица   расчета трехфазного тока короткого замыкания (величин начального действующего значения периодической составляющей тока — Iпо max)  в максимальном  режиме  на шинах РУНН-0,4 кВ и
Расчета однофазного тока короткого замыкания (Iпо(1)) в минимальном режиме в расчетной точке (окрасочно-сушильная камера);
Расчет ударного тока короткого замыкания (iуд.) в расчетных точках (шины РУНН-0,4 кВ, окрасочно-сушильная камера).
